import React from 'react'
import Modal from "../UI/Modal";
import Test from './Test';

function BillDetailTest(props) {
    const test=props.products.map((bp)=> 
    (<Test key={bp.bill_number} bn={bp.bill_number} pid={bp.product_id} pq={bp.product_quantity} pc={bp.products_cost}/>)
    );
  
    return (
    <Modal>
      <div>
      <div>
        <p>Bill Number: {props.bn}</p>
        <p>Total Cost: {props.tc}</p>
        <p>Credit Card: {props.cc}</p>
        <ul>
            {test}
        </ul>
      </div>
      </div>
      </Modal>
    );
  }
  

export default BillDetailTest
